import React from 'react'
import { Avatar, } from '@mui/material'

function AddFriend({ friend }) {

    const { username } = friend

    return (
        <div>
            <Avatar />
            <h2>{username}</h2>
            <button>Add Friend</button>
        </div>
    )
}

export default AddFriend
